import React from 'react';

export default function ActionLink(props) {
    
    
    function handleClick(product) {
      // e.preventDefault();
      console.log('The link was clicked.' + product.fields.title);
    }
  
    return (
      <a href="#" onClick={handleClick.bind(this, props.product)}>
        {/* {props.group} */}
          {props.product.fields[props.group][0]}
      </a>
    );
  }
